
-- Added auto-stop if "Fist of Darkness" is found
local function checkFistOfDarkness()
    for _, item in pairs(game:GetService("Players").LocalPlayer.Backpack:GetChildren()) do
        if item.Name == "Fist of Darkness" then
            if _G.AutoChest then
                _G.AutoChest = false
                warn("Fist of Darkness found - Auto Chest Collection stopped.")
            end
        end
    end
end

-- Call this function periodically
spawn(function()
    while task.wait(2) do
        pcall(checkFistOfDarkness)
    end
end)

